The Notebook is a 2004 romantic drama film directed by Nick Cassavetes, based on the novel of the same name by Nicholas Sparks. The film stars Ryan Gosling and Rachel McAdams as Noah and Allie, a young couple who fall in love during the early 1940s. Their story is narrated from the present day by an elderly man played by James Garner, telling the tale to a fellow patient, played by Gena Rowlands.
